import React from 'react';

function Genre() {
  return (
    <>
      <div >
        <h1>Genres</h1>

        <div class="row ">
          <div class="custom-col" >
            <div class ="card"><img class="card-img-top fixed-height-img" src="/public/logo192.png" alt="artistsPic" />
            <div class="card-header">

                {/* <Link to={`/artists/artistspage/${props.id}`}>{props.ArtistsName}</Link> */}
            </div>
            <div class="card-header">{props.Genre}</div>
            <div class="card-body p-5">{props.VenueList}</div></div>
          </div >
          <div class="custom-col" >
            <div class ="card">Pop</div>
          </div >
          <div class="custom-col" >
            <div class ="card bg-primary">Pop</div>
          </div >
          <div class="custom-col" >
            <div class ="card">Pop</div>
          </div >
          <div class="custom-col" >
            <div class ="card">Pop</div>
          </div >


        </div>

      </div>
    </>
    // <div>
    //   <h2>Genre</h2>
    //   <p>Pop, Country, Classic, Hip-Hop, and more!</p>
    // </div>
  );
}

export default Genre;
